import React from "react";


const Home = (products) => {


  return (


    <div className="container">
      <header className="jumbotron">
        <h3>ZERTYU</h3>

        {products.map(product => (
          <li key={product.productCode}>
            <p>product.productCode</p>
          </li>
        ))}
      </header>
    </div>
  );
};

export default Home;
